  return (
    <>
      <h1>글쓰기</h1>
      <Form>
        <Form.Item label="제목" name="title" rules={[{ reqired: true }]}>
          <Input />
        </Form.Item>
        <Form.Item label="작성자" name="author" rules={[{ reqired: true }]}>
          <Input />
        </Form.Item>
        <Form.Item label="글" name="content" rules={[{ reqired: true }]}>
          <WriteTextArea rows={10} />
        </Form.Item>
      </Form>
    </>
  );
};

export default Write;
